import "./index.scss"
export default function Myprofile() {
  return (
    <div>
      <div id="profile_img" ></div>
      <div id="username"><span style="display:none;">null</span><a href="https://github.com/Ronald-Kong">@Ronald-Kong</a></div>
    </div>
  )
}
